import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import CategoriesList from './components/CategoriesList';
import Home from './components/Home';
import './App.css';

function App() {
  return (
    <div>
      <Home />
      <BrowserRouter>
        <Route exact path="/" component={ CategoriesList } />
      </BrowserRouter>
    </div>
  );
}

export default App;
